import Link from 'next/link';
import Rating from './Rating';

export default ({ title, description, slug}) => (
  <div className="Session">
    <h2>
      <Link href={`/session?slug=${slug}`}>
        <a>{title}</a>
      </Link>
    </h2>
    <p>{description}</p>
    {rating && <Rating value={rating} />}
  </div>
);
